import "./contact.scss";

export default function Contact() {
    return (
        <div className='contact' id="contact">
            <div className="container">
                <div className="left">
                    <img src="../assets/shake.svg" />
                </div>

                <div className="right"></div>
                    <form>
                        <input type="email" />
                    </form>
            </div>
        </div>
    )
}
